import * as React from "react";
import css from "./PlacesPrice.module.scss";

export const PlacesPrice: React.FC<{ price: string }> = ({ price }) => {
  const currency: string = price[0];
  return price ? (
    <div className={css.placePrice}>
      <span className={css.light}>{price[0]}</span>
      <span className={price.length >= 2 ? css.light : null}>{currency}</span>
      <span className={price.length >= 3 ? css.light : null}>{currency}</span>
      <span className={price.length === 4 ? css.light : null}>{currency}</span>
    </div>
  ) : null;
};
